import { Avatar, Paper } from '@mui/material';
import React from 'react';


function Home() {
  return (
    <div className="container">

      <Paper elevation={3} />
      <div className="color-panel"></div>
      <Avatar style={{position:'absolute', left:'50%', transform: 'translate(-50%, -50%)'}} alt="Remy Sharp" src="/static/images/avatar/1.jpg" />
      <div className="content">
        {/* add main content here */}
      </div>
    </div>
  );
}

export default Home;
